import React from 'react';
import Card from './Card';

export default function Discover({ movieslist }) {

    return (
        <div className='dis-cont'>
            {
                movieslist.map((eachmovie) => {
                    <Card movie={eachmovie} />
                })
            }
        </div>
    )
}
